    function executeMetaTransaction(address userAddress, bytes memory functionSignature, bytes32 sigR, bytes32 sigS, uint8 sigV) public payable returns(bytes memory) {
        require(isSigner(userAddress, functionSignature, sigR, sigS, sigV), "Signer and signature do not match");

        nonces[userAddress]++;

        (bool success, bytes memory returnData) = address(this).delegatecall(abi.encodePacked(functionSignature, userAddress));
        require(success, "Function call failed");

        emit MetaTransactionExecuted(userAddress, payable(msg.sender), functionSignature);

        return returnData;
    }

    function isSigner(address userAddress, bytes memory functionSignature, bytes32 sigR, bytes32 sigS, uint8 sigV) public view returns(bool) {
        address msgSender = userAddress;
        uint256 nonce = nonces[userAddress];
        bytes32 msgHash = prefixed(keccak256(abi.encodePacked(msgSender, nonce, this, functionSignature)));
        address signer = ecrecover(msgHash, sigV, sigR, sigS);
        return (signer == userAddress);
    }

    function prefixed(bytes32 hash) internal pure returns (bytes32) {
        return keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", hash));
    }
